import { useEffect, useState } from "react";
import Pizza from "./Pizza";
import pizzaData from "./data.js";

export default function Menu() {
	return (
		<main className="menu">
			<h2>Our menu</h2>

			<div>
				{pizzaData.map((pizza) => {
					<Pizza
						key={pizza.name}
						name={pizza.name}
						ingredients={pizza.ingredients}
						photoName={pizza.name}
						price={pizza.price}
					/>;
				})}
			</div>
		</main>
	);
}
